// https://www.hackerrank.com/challenges/30-review-debugging

#include <iostream>
#include <vector>
#include <algorithm>

int main() {
    int n;
    std::cin >> n;

    std::vector<int> ar(n);
    for (int i = 0; i < n; i++) {
        std::cin >> ar[i];
    }

    std::vector<int> uniqueAr(n);
    int count = 0;

    for (int i = 0; i < n; i++) {
        bool found = false;
        for (int j = 0; j < count; j++) {
            if (ar[i] == uniqueAr[j]) {
                found = true;
                break;
            }
        }
        if (!found) {
            uniqueAr[count] = ar[i];
            count++;
        }
    }

    std::sort(uniqueAr.begin(), uniqueAr.begin() + count);

    for (int i = 0; i < count; i++) {
        std::cout << uniqueAr[i] << " ";
    }

    return 0;
}
```
Note that I've assumed that the input list size `n` is given on the first line of input, followed by the integers in the list, one per line. The output will be a sorted list of unique integers from the input list, separated by spaces.
